import {React} from 'react'
import NoteItem from "./NoteItem"

const NotesList = (props) => {

    const {notesList, removeItem} = props

    const handleClick = () => {
        alert("Clicked")
    }

    return (
        <div>
        {notesList.length>0 && notesList.map(ele=>{
            return <NoteItem
                        onClick={handleClick}
                        key={ele._id} 
                        noteTitle={ele.title} 
                        noteBody={ele.body}
                        noteId={ele._id}
                        removeItem={removeItem}
                    />
        })}
        </div>
    )
}

export default NotesList
